let currentGloss;

function highlight() {
    const el1 = document.getElementById(currentGloss);

    if (!el1) return;
    clearHighlight();
    el1.style.backgroundColor = 'rgba(169, 218, 178, 0.8)';
}

function clearHighlight() {
    const el2 = document.getElementById(currentGloss);

    if (!el2) return;

    el2.style.backgroundColor = 'rgba(245, 236, 212, 0)';
}


