//Infinitive check checks if the input item is already in the dictionary.
// It works only for non-verbal items because verbs will be parsed in infinitive form, so they go through the verbal_parsing (see below).


function infinitive_check (word) {
    if (dictionary_IPA.includes(word) && dictionary[word]["part_of_speech"] !== "verb") {
        const word_parsing_result = {word: "", morphemes: [], part_of_speech: ""};
        word_parsing_result.word = word;
        word_parsing_result.translation = dictionary[word]["spanish"];
        word_parsing_result.part_of_speech = "non-verb";
        word_parsing_result.inputWas = word;
        return word_parsing_result;

    } else if (variations_IPA.includes(word) && dictionary[variations[word]]["part_of_speech"] !== "verb") {
        const word_parsing_result = {word: "", translation: "", morphemes: [], part_of_speech: ""};
        word_parsing_result.word = word;
        word_parsing_result.translation = dictionary[variations[word]]["spanish"];
        word_parsing_result.part_of_speech = "non-verb";
        word_parsing_result.inputWas = word;
        return word_parsing_result;

    } else if (word === "la"|| word === "le" || word === "de" || word === "las" || word === "los") {
        const word_parsing_result = {word: "", translation: "", morphemes: [], part_of_speech: "non-verb"};
        word_parsing_result.word = word;
        word_parsing_result.translation = word;
        word_parsing_result.inputWas = word;
        return word_parsing_result;

    } else if (word.endsWith("s")) {
        const plur = "s";
        const sing = word.slice(0, ~(plur.length - 1));
        if (dictionary_IPA.includes(sing)) {
           const word_parsing_result = {word: "", morphemes: [], part_of_speech: ""};
           word_parsing_result.word = sing;
           word_parsing_result.translation = dictionary[sing]["spanish"];
           word_parsing_result.part_of_speech = "non-verb";
           word_parsing_result.inputWas = word;
           return word_parsing_result;
        } else if (variations_IPA.includes(sing)) {
           const word_parsing_result = {word: "", morphemes: [], part_of_speech: ""};
           word_parsing_result.word = sing;
           word_parsing_result.translation = dictionary[sing]["spanish"];
           word_parsing_result.part_of_speech = "non-verb";
           word_parsing_result.inputWas = word;
           return word_parsing_result;
        }
    }

}



//Nom parsing function works with the non-verbal items.
//First it checks if the word ends with the non-verbal morpheme and then check if the word is in the dictionary or among variations.
//If this possible stem is in the dictionary, script gives output.

function nom_parsing(word) {
    for (let i = 0; i < other_types_morphemes.length; i++) {
        const morpheme = other_types_morphemes[i];

        if (word.endsWith(morpheme) && word.length - morpheme.length !== 0) {
            const possible_stem = word.slice(0, ~(morpheme.length - 1));
            console.log(possible_stem);
            morphemes_nominal.unshift(morpheme);
            if (dictionary_IPA.includes(possible_stem) && dictionary[possible_stem]["part_of_speech"] !== "verb") {
                const nom_morphemes_to_return = morphemes_nominal.slice();
                const word_parsing_result = {word: "", translation: "", morphemes: [], part_of_speech:""};
                morphemes_nominal = [];
                morphemes_verbal = [];
                word_parsing_result.word = possible_stem;
                word_parsing_result.translation = dictionary[possible_stem]['spanish'];
                word_parsing_result.part_of_speech = dictionary[possible_stem]['part_of_speech'];
                word_parsing_result.inputWas = word;
                nom_morphemes_to_return.forEach(m => {
                    word_parsing_result.morphemes.push ({morph: m, gloss: other_types_morphemes_dict[m]["Gloss"], gloss_meaning: other_types_morphemes_dict[m]["Meaning Gloss"]});
                });
                if (nom_morphemes_to_return.includes("lla") && nom_morphemes_to_return.includes("ta")) {
                    console.log (" ")
                } else {
                return word_parsing_result
                }

            } else if (variations_IPA.includes(possible_stem) && dictionary[possible_stem]["part_of_speech"] !== "verb") {
                const nom_morphemes_to_return = morphemes_nominal.slice();
                const word_parsing_result = {word: "", translation: "", morphemes: [], part_of_speech: ""};
                morphemes_nominal = [];
                morphemes_verbal = [];
                word_parsing_result.word = possible_stem;
                word_parsing_result.translation = dictionary[variations[possible_stem]]['spanish'];
                word_parsing_result.part_of_speech = dictionary[variations[possible_stem]]['part_of_speech'];
                word_parsing_result.inputWas = word;
                nom_morphemes_to_return.forEach(m => {
                    word_parsing_result.morphemes.push({
                        morph: m,
                        gloss: other_types_morphemes_dict[m]["Gloss"],
                        gloss_meaning: other_types_morphemes_dict[m]["Meaning Gloss"]
                    });
                });
                if (nom_morphemes_to_return.includes("lla") && nom_morphemes_to_return.includes("ta")) {
                    console.log(" ")
                } else if ((nom_morphemes_to_return.includes("xo") || nom_morphemes_to_return.includes("xu")|| nom_morphemes_to_return.includes("ku")) && nom_morphemes_to_return.length === 1) {
                    console.log(" ")
                } else {
                    return word_parsing_result;
                }
            }
         else {
                return nom_parsing(possible_stem);
            }
        }
    }
}

